object.script:
zooms={
	1000,
	2000,
	4000,
	8000,
	10000,
	20000,
	40000
}

function gn(n)
	return input.getNumber(n)
end

function sn(n,v)
	output.setNumber(n,v)
end

function gb(n)
	return input.getBool(n)
end

function sb(n,v)
	output.setBool(n,v)
end

function onTick()
	local i
	local z=gn(32)

	for i=1,32 do
		sn(i,gn(i))
		sb(i,gb(i))
	end

	sn(32, zooms[math.floor(z)] )
end

function onDraw()
end
